import React from "react";
import styled from "styled-components";

// Styled-components로 스타일 정의
const MainWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  text-align: center; /* contentStyle의 textAlign */
  flex: 1; /* contentStyle의 flex */
  line-height: 120px; /* contentStyle의 lineHeight */
  color: #fff; /* contentStyle의 color */
  background-color: #000; /* contentStyle의 backgroundColor */
`;

const SubTitle = styled.h2`
  font-size: 1.5rem;
  margin-bottom: 16px;
`;

const MainTitle = styled.h1`
  font-size: 3rem;
  font-weight: bold;
  margin-bottom: 24px;
`;

const StartButton = styled.button`
  padding: 12px 24px;
  font-size: 1rem;
  color: #000;
  background-color: #fff;
  border: none;
  border-radius: 4px;
  cursor: pointer;
  transition: background-color 0.3s;

  &:hover {
    background-color: #ddd;
  }
`;

// MainContent 컴포넌트 정의
function MainContent() {
  return (
    <MainWrapper>
      <SubTitle>MZ세대의 언어로 가득 찬 힙한 단어사전</SubTitle>
      <MainTitle>MZ Generaation 
      <br />Word Dictionary</MainTitle>
      <StartButton>Get Started</StartButton>
    </MainWrapper>
  );
}

export default MainContent;
